import React from 'react';
import logo from './logo.svg';
import './App.css';
import Matrix from './matrix/Matrix';


function App() {
  var data = [
  [{key:0},{key:1},{key:2}],
  [{key:3},{key:4},{key:5}],
  [{key:6},{key:7},{key:8}],
]

  return (
    <div className="App">
      <div className="matrix">
        <Matrix data={data} id ="matrix"/>
      </div>
    </div>
  );
}

export default App;
